import { jsPDF } from 'jspdf';
var font =
  '';

var font2 =
  '';
var callAddFont = function () {
  this.addFileToVFS('LoveYaLikeASister-Regular-normal.ttf', font);
  this.addFont(
    'LoveYaLikeASister-Regular-normal.ttf',
    'LoveYaLikeASister-Regular',
    'normal'
  );

  this.addFileToVFS('Karla-VariableFont_wght-normal.ttf', font2);
  this.addFont('Karla-VariableFont_wght-normal.ttf', 'Karla-VariableFont_wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont]);
